import React, { Component } from 'react'
import './Aboutus.css';
export default class Aboutus extends Component {
    render() {
        return (
            <div className="rank">
                <center>
               <h2>Welcome to About us page</h2>
               
    <img src="https://www.rd.com/wp-content/uploads/2018/01/01_Common-Myths-About-Airplanes-You-Need-to-Stop-Believing_559714906_motive56-760x506.jpg" className="rs"/>
    <br />
    <p>An airplane or aeroplane (informally plane) is a powered, fixed-wing aircraft that is propelled forward by thrust from a jet engine, propeller or rocket engine. Airplanes come in a variety of sizes, shapes, and wing configurations. The broad spectrum of uses for airplanes includes recreation, transportation of goods and people, military, and research. Worldwide, commercial aviation transports more than four billion passengers annually on airliners[1] and transports more than 200 billion tonne-kilometers[2] of cargo annually, which is less than 1% of the world's cargo movement.[3] Most airplanes are flown by a pilot on board the aircraft, but some are designed to be remotely or computer-controlled such as drones.</p>
    </center><center><br />
    <input class="btn btn-primary" type="submit" value="Read more.."></input><br /></center>
    <div className="footer">
    <p>@copyright@2016 Rwenzori Airline.All right reserve</p>
  </div>
  
            </div>
        )
    }
}
